import React, { useEffect } from "react";
import "./Header.css";
import { Carousel } from 'react-bootstrap';
import logo from "/My project/ca/src/Assets/ca-logo.png";

// import heading from "/My project/ca/src/Assets/cheading.png";

function Header() {
  function openNav() {
    document.getElementById("mySidenav").style.width = "100%";
  }

  function closeNav(e) {
    e.preventDefault();
    document.getElementById("mySidenav").style.width = "0";
  }
  useEffect(() => {
    var header = document.getElementById("nav");
var btns = header.getElementsByClassName("navbar__links1");
for (var i = 0; i < btns.length; i++) {
  btns[i].addEventListener("click", () => {
  var current = document.getElementsByClassName("active");
  current[0].className = current[0].className.replace(" active", "");
  this.className += " active";
  });
}
  })
  

  return (
    <div>
      <div className="header">
        <div className="header__left">
          <div className="header__logo">
            <img src={logo} alt="" />
          </div>
        </div>

        <div className="header__right">
          <div id="nav" className="navbar__links">
            {/* <ul>
              <li className="navbar__links">Home</li>
              <li className="navbar__links">About us</li>
              <li className="navbar__links">Services</li>
              <li className="navbar__links">Blogs</li>
              <li className="navbar__links">Contact us</li>
            </ul> */}
            <a href="as" className="navbar__links1 active">About</a>
            <a href="as" className="navbar__links1">Services</a>
            <a href="as" className="navbar__links1">Blogs</a>
            <a href="as" className="navbar__links1">Contact Us</a>
            <a href="as" className="navbar__links1">Home</a>

          </div>
          <button className="header__right_button">Call us</button>
          <div className="hamburger">
            <div id="mySidenav" className="sidenav">
              <a href="a" className="closebtn" onClick={closeNav}>
                &times;
              </a>
              <a href="sf" className="hamburger__links">
                About
              </a>
              <a href="shd" className="hamburger__links">
                Services
              </a>
              <a href="gds" className="hamburger__links">
                Clients
              </a>
              <a href="gd" className="hamburger__links">
                Contact
              </a>
            </div>

            <span
              className="hamburger__button"
              style={{ fontSize: "30px", cursor: "pointer", float: "right" }}
              onClick={openNav}
            >
              &#9776;
            </span>
          </div>
        </div>
      </div>
      <Carousel fade>
  <Carousel.Item>
    <img
      className="d-block w-100"
      src={logo}
      alt="First slide"
    />
    <Carousel.Caption>
      <h3>First slide label</h3>
      <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
    </Carousel.Caption>
  </Carousel.Item>
  <Carousel.Item>
    <img
      className="d-block w-200"
      src={logo}
      alt="Second slide"
    />

    <Carousel.Caption>
      <h3>Second slide label</h3>
      <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
    </Carousel.Caption>
  </Carousel.Item>
  <Carousel.Item>
    <img
      className="d-block w-100"
      src="holder.js/800x400?text=Third slide&bg=20232a"
      alt="Third slide"
    />

    <Carousel.Caption>
      <h3>Third slide label</h3>
      <p>Praesent commodo cursus magna, vel scelerisque nisl consectetur.</p>
    </Carousel.Caption>
  </Carousel.Item>
</Carousel>
    </div>
  );
}

export default Header;
